A more robust way to get the name is to use an optional pattern:

```sparql
SELECT ?name WHERE {
  ?port a ns1:Port ;
        ns1:hasLatitude ?lat .
  OPTIONAL { ?port rdfs:label ?name }
}
ORDER BY DESC(?lat)
LIMIT 1
```

This query first selects ports with latitude and then optionally retrieves their names. If a port doesn't have an `rdfs:label`, the `?name` variable will be unbound, but the query will still return the port with the highest latitude.

